      <div className='backdrop is-active'>
        <div className='nav--box'>
          <div className='btn__closed'>
            <a
              href='#specialties'
              className='btn__closed--animated closed-position'
            >
              <span></span>
              <span></span>
            </a>
          </div>
          {props.children}
        </div>
      </div>
    );
  }
}

export default drawer;
